import React from "react";

function ContactCard({ user, privNotes }) {
    return (
        <div className="contact-card">
            <h3>{user.name}</h3>
            <p>{user.pronouns}</p>
            <p>{user.dob}</p>
            <img src={user.pic} alt={`${user.name} picture`} />
            <p>{user.email}</p>
            <p>{user.phone}</p>
            <p>{user.address}</p>
            <p>Their Notes: {user.addnotes}</p>
            <form>
                <label htmlFor="priv-notes">Your Notes:</label>
                <input type="textbox" defaultValue={privNotes}></input>
                <input type="submit" />
            </form>
        </div>
    );
};

export default ContactCard;
